import { observable, action } from "mobx";
import axios from "axios";

export class admin {
  @observable dbTable = {};
  @observable dbName = "";
  @action
  createTableInfo() {
    console.log();
    return axios
      .get("https://hanstream.gabia.io/adminCreateFile", {
        params: {
          dbName: this.dbName,
        },
      })
      .then((response) => {
        alert("추가완료했습니다.");
        console.log(response.data);
      })
      .catch((error) => {
        alert("error");
        console.log(error);
      });
  }
  @action
  async createTable() {
    await this.createTableInfo();
  }

  @action
  insertTableInfo() {
    return axios
      .get("https://hanstream.gabia.io/insertDBValue", {})
      .then((response) => {
        console.log(response.data);
        this.dbTable = response.data;
      })
      .catch((error) => {
        console.log(error);
      });
  }
  @action
  async insertTable() {
    await this.insertTableInfo();
  }

  @action
  getTableInfo() {
    return axios
      .get("https://hanstream.gabia.io/adminDBTable", {})
      .then((response) => {
        console.log(response.data);
        this.dbTable = response.data;
      })
      .catch((error) => {
        console.log(error);
      });
  }
  @action
  async getTable() {
    await this.getTableInfo();
  }
}
